('2354','18','7879','Villa Nardine',Null,'Einfamilenhaus in Cala Vinas, im Südwesten Mallorcas zu verkaufen','33162','Das gepflegte Einfamilenhaus liegt in der Gemeinde Calvia im Südwesten von Mallorca. Nach Palma sind es ca 15 Fahrminuten. Mehrere Golfplätze, Jachthäfen mit schicken Restaurants, Supermärkte und internat. Schulen machen diese Wohnlage für viele Residenten so interessant. Die Villa eignet sich auch hervorragend als Urlaubsimmobilie. Die ca 350m² Wohnfläche verteilt sich auf 2 Wohnetagen. Im EG befinden sich das Wohn-Esszimmer, die Küche mit Hauswirtschaftsraum, Gäste WC und eine überdachte Terrasse mit Zugang zum Pool und Garten. Im 1 OG bietet die Villa 2 Gäste Schlafzimmer und ein Hauptschlafzimmer. Alle SZ haben ein Badezimmer en suite. Zur Ausstattung gehören Doppelglasfenster, Alu Fensterläden. Klimaanlage w/k, Einbauküche mit allen Geräten u.v.m','33163','1240000','106','2015-07-24 13:25:54','106','2015-07-24 13:26:52',Null,'2433','125','1144',1,'1','0',Null,Null,Null,'33164',Null,'0','0','0',Null,'2015-07-24 13:33:45',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33165',Null,'33166',Null,'33167',Null,'33168','Mobile: 600 424 234','33169','0',0,'7');
